CREATE PROCEDURE [dbo].[r2rGetSharedBots]
	@userId int  
AS
BEGIN
	SET NOCOUNT ON;

	SELECT 
	a.*, 
	b.Name AS [ApproverAdminName], 
	c.Name AS [ApproverManagerName],
	d.access AS [BotAccess]
	FROM r2rBotHdr a
	LEFT JOIN r2rUserMst b ON a.FKApproverAdmin = b.Id
	LEFT JOIN r2rUserMst c ON a.FKApproverManager = c.Id
	LEFT JOIN r2rBotUserDtl d ON a.Id = d.FKBot 
	WHERE a.active = 1 AND d.FKUser = @userId
	ORDER BY a.id DESC
END



