CREATE PROCEDURE [dbo].[r2rGetUserByEmail]
	@email nvarchar(500),
	@pwd nvarchar(500)
AS
BEGIN
	SET NOCOUNT ON;

	SELECT 
	a.*, 
	isnull(b.Title,0) AS [TitleRole], 
	isnull(c.Title,'') AS [TitleTeam],
	isnull(d.Id,0) AS [TeamManagerId],
	isnull(d.Name,'') AS [TeamManagerName]
	FROM r2rUserMst a
	LEFT JOIN r2rRoleMst b ON a.FKRole = b.Id
	LEFT JOIN (r2rTeamMst c LEFT JOIN r2rUserMst d ON  d.Id = c.FKManager) ON a.FKTeam = c.Id
	WHERE a.email = @email and a.pwd = @pwd


END


