CREATE procedure [dbo].[R2rInsertBotHdr]
(
@title	nvarchar(500),
@FKCreatedBy	nvarchar(500),
--@xaml	nvarchar(max),
@functionality	nvarchar(500),
@benefit	nvarchar(500),
@FKTeam	nvarchar(500),
@type	nvarchar(500),
@FKApproverAdmin	nvarchar(500),
@FKApproverManager	nvarchar(500),
@isApprovedAdmin	bit,
@isApprovedManager	bit,
@noOfPeople	nvarchar(500),
@manualMins	nvarchar(500),
@tech	nvarchar(500),
@apps	nvarchar(500),
--@active	nvarchar(500),
--@createdDate	datetime,
--@modifiedDate	datetime,
@isProduction bit
)
as
begin 
  INSERT INTO r2rBotHdr (title, FKCreatedBy, xaml, functionality, benefit, FKTeam, type, FKApproverAdmin, FKApproverManager,
   isApprovedAdmin, isApprovedManager, noOfPeople, manualMins, tech, apps, active, isProduction) 
  VALUES (@title,  @FKCreatedBy, '', @functionality, @benefit, @FKTeam, @type, @FKApproverAdmin, @FKApproverManager, 
  @isApprovedAdmin, @isApprovedManager,  @noOfPeople, @manualMins, @tech, @apps, 1,@isProduction)
end 
