CREATE procedure [dbo].[r2rReport]

As
begin

truncate table r2rTmpProdBots

insert into r2rTmpProdBots  select distinct a.id,a.title from r2rBotHdr a  inner join r2rbotrundtl b on a.id=b.fkbot and b.testrun = 0  where a.id
not in(select fkbot from r2rbotrundtl where testrun = 0  
and convert(date,runDate,101) between convert(date,getdate()-7,101) and convert(date,getdate(),101))


--select distinct Fkbot,title from r2rbotrundtl br
--inner join r2rBotHdr b on b.id=br.fkbot where testrun = 0
-- and  convert(date,runDate,101) between convert(date,getdate()-10,101) and convert(date,getdate(),101)  not in 
--(select distinct fkbot from r2rbotrundtl where testrun = 0 ) 


--------------Original store Proc-------------------------
select title as [Bot Name],convert(varchar(10),runDate,111) as [Run Date],convert(varchar(10),startDate,108) as [Start Time],
convert(varchar(10),endDate,108) as [End Time],tranCount as [Transaction Processed],tranCount*manualMins as [Effort Savings (Mins.)],
(tranCount*manualMins - (DATEDIFF (MINUTE , startDate,endDate)) )as [TaT Savings (Mins.)] from r2rbotrundtl br
inner join r2rBotHdr b on b.id=br.fkbot
where  (convert(date,br.runDate,101) between convert(date,getdate()-7,101) and convert(date,getdate(),101)) and testRun=0  order by title,runDate desc  



END





